import { createAction, props } from '@ngrx/store';
import { DynamicQueryPart, WithId } from '../state';
import { SuccessPayload, ErrorPayload } from '../message/message.actions';
import { SampleData } from './sample.state';

export const searchSampleData = createAction('[API] Search Sample Data', props<{queryParams: DynamicQueryPart} & WithId>());
export const searchSampleDataSuccess = createAction('[API] Search Sample Data Success', props<SuccessPayload<{result: SampleData[]}> & WithId>());
export const searchSampleDataError = createAction('[API] Search Sample Data Error', props<ErrorPayload & WithId>());

export const changeSampleDataFilters = createAction('[API] Change Sample Data Filters', props<{queryParams: DynamicQueryPart} & WithId>());
